As mentioned in the introduction, the simplest Asteracea component is E()()[]. In context, and written more like what you'd see in the wild: asteracea::component! { pub Empty()() []
} (All Asteracea component examples are followed by their output as rendered by lignin-html , but in this case it's an empty string.) This component expands to the following Rust code, with use imports extracted by hand and a little manual formatting: use asteracea::lignin_schema::lignin::{bumpalo::Bump, Node}; pub struct Empty {} impl Empty { pub fn new() -> Self { Self {} } pub fn render<'bump>(&self, bump: &'bump Bump) -> Node<'bump> { (Node::Multi(&*bump.alloc_with(|| []))) }
} As you can see, the component! macro created one struct type, with one constructor called new and one method called render. The output of component!, as far as you're supposed to touch it, always has this shape. No exceptions. (The macro can currently, under certain circumstances, create colliding definitions of structs called NewStatics and RenderStatics. This is a bug and will be fixed prior to release. If this happens to you, place your components in different modules. These types are not part of the public interface, and strictly speaking not something you're supposed to touch explicitly, and won't interfere further than this.) The parentheses around the body of render aren't strictly needed here... and you may find small bits of similar useless syntax in other positions too. The most simple explanation is that they're leftovers that will be cleaned up eventually (when more tests exist), but sometimes these pieces of code nudge Rust into giving you a better error message or block off certain edge cases (usually inner attributes) that either would be confusing to read or haven't been properly evaluated yet.
